import React, { useEffect, useState } from "react";
import "./HomePage.css";

const HomePage = ({ user, search }) => {
  const { userName } = user;
  const firstName = userName.split(" ").slice(0, 1);
  const apiKey = "ef7fd608-e4ba-4e7d-b63c-8fcc4fd8f9f1";
  useEffect(() => {
    async function getNews() {
      let response = await fetch(
        `https://content.guardianapis.com/search?${search}api-key=${apiKey}`
      );
      let data = await response.json();
      console.log(data);
      const news = data.response.results;
      console.log(data.response.currentPage);
    }
    getNews();
  }, []);
  return (
    <div>
      <header>Welcome {firstName}!</header>
      <main>
        <h2>Top Stories</h2>
        <section>
          {news.map((item) => {
            <h3>{item.webTitle}</h3>;
          })}
        </section>
      </main>
    </div>
  );
};

export default HomePage;
